import express from "express"
const Cartrouter = express.Router()
import Cart from "../models/Cart"
import bcrypt from "bcrypt"
import jwt from "jsonwebtoken"
import { valiToken, valiTokenAdmin, vali } from "./verifytoken"


Cartrouter.post("/addCart", vali, async (req, res) => {
    try {
        console.log(req.body)
        let update;
        let save;
        let add;
        const existed = await Cart.findOne({
            id: req.body.id,
            userID: req.body.
                userID,
            variant: req.body.variant
        })
        console.log(existed)

        if (existed) {
            console.log("existed")
            // update = await Cart.updateOne({ id: req.body.id, userID: req.body.userID, variant: req.body.variant }, { $inc: { quantity: +1, price: + existed.single } })
            update = await Cart.updateOne({ id: req.body.id, userID: req.body.userID, variant: req.body.variant }, { $inc: { quantity: req.body.quantity, price: req.body.price } })
            console.log("update", update)


        } else {
            console.log("else")
            add = new Cart({
                ...req.body

            })
            save = await add.save()


        }




        if (save) {
            return res.status(201).json({
                user: add,
                message: "successfully created"
            })
        }

        else if (update) {
            return res.status(201).json({
                user: req.body,
                message: "successfully updated"
            })
        }
        else {
            return res.status(400).json({
                message: "something went wrong"
            })
        }


    } catch (err) {
        res.status(500).json({
            message: err.message
        })
    }
})

Cartrouter.put("/updateCart/:id", vali, async (req, res) => {
    try {
        const { message, data } = req.body
        let update;

        console.log(message, data)
        if (message == "increment") {



            update = await Cart.updateOne({ _id: req.params.id }, { $inc: { quantity: +1, price: + data.single } })


        }
        if (message == "decrement") {
            console.log(data.pricee)
            update = await Cart.updateOne({ _id: req.params.id }, { $inc: { quantity: -1, price: -data.single } })


        }




        if (update) {
            return res.status(201).json({
                cart: update,
                message: "successfully updated"
            })
        } else {
            return res.status(400).json({
                message: "something went wrong"
            })
        }


    } catch (err) {
        res.status(500).json({
            message: err.message
        })
    }
})
Cartrouter.delete("/cartDelete/:id", vali, async (req, res) => {
    try {
        const del = await Cart.deleteOne({ _id: req.params.id })


        if (del) {
            return res.status(201).json({
                user: del,
                message: "successfully deleted"
            })
        } else {
            return res.status(400).json({
                message: "something went wrong"
            })
        }


    } catch (err) {
        res.status(500).json({
            message: err.message
        })
    }
})
//get cart

Cartrouter.get("/cart/:id", vali, async (req, res) => {
    try {
        const data = await Cart.find({ userID: req.params.id })
        console.log(data)


        if (data) {
            return res.status(200).json({
                cart: data,
                message: "successfully fetched"
            })
        } else {
            return res.status(400).json({
                message: "something went wrong"
            })
        }


    } catch (err) {
        res.status(500).json({
            message: err.message
        })
    }
})

//get all users


Cartrouter.get("/products", valiTokenAdmin, async (req, res) => {
    try {

        const data = await Cart.find({

        })


        if (data) {
            return res.status(200).json({
                carts: data,
                message: "successfully fetched"
            })
        } else {
            return res.status(400).json({
                message: "something went wrong"
            })
        }


    } catch (err) {
        res.status(500).json({
            message: err.message
        })
    }
})

